import React from 'react'
class NotesComponent extends React.Component{
    render() {
        return (
            <div>
                <form onSubmit={this.handleSubmit} className='ui form'>
                    <div className='field'>
                        <label htmlFor="Note Here">Video Search</label>
                        <input onChange={this.handleChange} name='Note Here' type="text" placeholder="Search.."/>
                    </div>
                </form>
            </div>
        )
    }
}
export default NotesComponent
